  "translationLines": [
    {
      "lineNumber": 116981,
      "originalJapaneseLine": "ランスがシィルを探して城内をうろうろしていた。",
      "translatedEnglishLine": "Rance was wandering around the castle looking for Sil."
    },
    {
      "lineNumber": 116982,
      "originalJapaneseLine": "「あの馬鹿、この俺様が呼んでいるというのに、",
      "translatedEnglishLine": "\"That idiot, even though I'm calling him,"
    },
    {
      "lineNumber": 116983,
      "originalJapaneseLine": "　いったいどこで何してやがる！」",
      "translatedEnglishLine": "what on earth is he doing and where!\""
    },
    {
      "lineNumber": 116984,
      "originalJapaneseLine": "「奴隷としての自覚が足りん！",
      "translatedEnglishLine": "\"You have no awareness of being a slave!"
    },
    {
      "lineNumber": 116985,
      "originalJapaneseLine": "　戻ったらお仕置きだ、ぷんぷん！」",
      "translatedEnglishLine": "There's punishment waiting when you come back, grr!\""
    },
    {
      "lineNumber": 116986,
      "originalJapaneseLine": "「おっかえりー」",
      "translatedEnglishLine": "\"Welcome back!\""
    },
    {
      "lineNumber": 116987,
      "originalJapaneseLine": "「あれ？　なんでお前が俺の部屋に？」",
      "translatedEnglishLine": "\"Huh? Why are you in my room?\""
    },
    {
      "lineNumber": 116988,
      "originalJapaneseLine": "「んっふふー、お探しのものはこれかしら？」",
      "translatedEnglishLine": "\"Mmmfufu— Is this what you were looking for?\""
    },
    {
      "lineNumber": 116989,
      "originalJapaneseLine": "「なっ、それは！」",
      "translatedEnglishLine": "\"Wha, that is!\""
    },
    {
      "lineNumber": 116990,
      "originalJapaneseLine": "「あーん、ランス様、ランス様ー」",
      "translatedEnglishLine": "\"Aah, Lord Rance, Lord Rance—\""
    },
    {
      "lineNumber": 116991,
      "originalJapaneseLine": "なんと、シィルはアトランタの持つ",
      "translatedEnglishLine": "Lo and behold, Sil was trapped"
    },
    {
      "lineNumber": 116992,
      "originalJapaneseLine": "手鏡の中に閉じ込められていた。",
      "translatedEnglishLine": "inside the hand mirror held by Atlanta."
    },
    {
      "lineNumber": 116993,
      "originalJapaneseLine": "「このアホ！　なにを捕まってやがる！",
      "translatedEnglishLine": "\"You fool! What are you getting caught for!"
    },
    {
      "lineNumber": 116994,
      "originalJapaneseLine": "　あとでお仕置き百連発だぞ！」",
      "translatedEnglishLine": "You’re going to get a hundred punishments later!\""
    },
    {
      "lineNumber": 116995,
      "originalJapaneseLine": "「ひんひん、すみません」",
      "translatedEnglishLine": "\"Whimper, I'm sorry.\""
    },
    {
      "lineNumber": 116996,
      "originalJapaneseLine": "「むむむ、最近大人しくしとると思ったら、",
      "translatedEnglishLine": "\"Hmm, I thought you'd been quiet lately,"
    },
    {
      "lineNumber": 116997,
      "originalJapaneseLine": "　馬鹿なことをしおって、アトランタめ……」",
      "translatedEnglishLine": "but you went and did something stupid, that Atlanta...\""
    },
    {
      "lineNumber": 116998,
      "originalJapaneseLine": "「あんたの大事なだーいじな奴隷ちゃんは、",
      "translatedEnglishLine": "\"Your precious, very precious slave,"
    },
    {
      "lineNumber": 116999,
      "originalJapaneseLine": "　これこの通り、鏡の中に閉じ込めた」",
      "translatedEnglishLine": "I've locked inside this mirror right here.\""
    },
    {
      "lineNumber": 117000,
      "originalJapaneseLine": "「さあ、取引と行きましょう、ランス」",
      "translatedEnglishLine": "\"Now, let's make a deal, Rance.\""
    },
    {
      "lineNumber": 117001,
      "originalJapaneseLine": "「取引だと？」",
      "translatedEnglishLine": "\"A deal?\""
    },
    {
      "lineNumber": 117002,
      "originalJapaneseLine": "「私の望みはレキシントン様を返してもらうこと。",
      "translatedEnglishLine": "\"What I want is for you to return Lord Lexington."
    },
    {
      "lineNumber": 117003,
      "originalJapaneseLine": "　それさえ叶えば、このお嬢ちゃんは返すわ」",
      "translatedEnglishLine": "If that happens, I'll return this young lady.\""
    },
    {
      "lineNumber": 117004,
      "originalJapaneseLine": "「嘘つけ。",
      "translatedEnglishLine": "\"Don't lie."
    },
    {
      "lineNumber": 117005,
      "originalJapaneseLine": "　そんなに素直に返すようなタマじゃないだろ」",
      "translatedEnglishLine": "You’re not the kind to return her so easily.\""
    },
    {
      "lineNumber": 117006,
      "originalJapaneseLine": "アトランタがにっと笑った。",
      "translatedEnglishLine": "Atlanta grinned broadly."
    },
    {
      "lineNumber": 117007,
      "originalJapaneseLine": "「さっすがランス、冴えてる〜。",
      "translatedEnglishLine": "\"As expected of Rance, sharp as ever—"
    },
    {
      "lineNumber": 117008,
      "originalJapaneseLine": "　そういうとこ、大好きよ」",
      "translatedEnglishLine": "that's the part I love.\""
    },
    {
      "lineNumber": 117009,
      "originalJapaneseLine": "「もちろん、素直には返さない」",
      "translatedEnglishLine": "\"Of course, I won't give her back so easily.\""
    },
    {
      "lineNumber": 117010,
      "originalJapaneseLine": "「レキシントン様の魔血魂を飲んで貰うわ」",
      "translatedEnglishLine": "\"You will drink Lord Lexington's Magic Blood Spirit.\""
    },
    {
      "lineNumber": 117011,
      "originalJapaneseLine": "「なんだとぉ？」",
      "translatedEnglishLine": "\"What did you say?!\""
    },
    {
      "lineNumber": 117012,
      "originalJapaneseLine": "「私が魔血魂を飲ませる条件はね、",
      "translatedEnglishLine": "\"The condition for me to make you drink the Magic Blood Spirit is,"
    },
    {
      "lineNumber": 117013,
      "originalJapaneseLine": "　強くて、悪い奴なこと……」",
      "translatedEnglishLine": "that you be strong and a bad guy...\""
    },
    {
      "lineNumber": 117014,
      "originalJapaneseLine": "「ランスは完璧よ。まさに私が求めている、",
      "translatedEnglishLine": "\"Rance is perfect. Exactly what I’m looking for,"
    },
    {
      "lineNumber": 117015,
      "originalJapaneseLine": "　魔血魂を飲ませてもいい、強くて悪い奴」",
      "translatedEnglishLine": "someone strong and bad enough to drink the Magic Blood Spirit.\""
    },
    {
      "lineNumber": 117016,
      "originalJapaneseLine": "「悪い話じゃないでしょ？",
      "translatedEnglishLine": "\"It's not a bad deal, right?"
    },
    {
      "lineNumber": 117017,
      "originalJapaneseLine": "　もしかしたら魔人になれるかも知れないんだから」",
      "translatedEnglishLine": "You might even become a demon lord after all.\""
    },
    {
      "lineNumber": 117018,
      "originalJapaneseLine": "「ま、失敗したら、",
      "translatedEnglishLine": "\"Well, if you fail,"
    },
    {
      "lineNumber": 117019,
      "originalJapaneseLine": "　レキシントン様に意識を乗っ取られるけど」",
      "translatedEnglishLine": "Lord Lexington’s consciousness will take over you.\""
    },
    {
      "lineNumber": 117020,
      "originalJapaneseLine": "「ふん、魔人にも、レキシントンにもなる気はない」",
      "translatedEnglishLine": "\"Hmph, I have no intention of becoming a demon lord or Lexington.\""
    },
    {
      "lineNumber": 117021,
      "originalJapaneseLine": "「これ、な〜んだ」",
      "translatedEnglishLine": "\"What’s this, hmm?\""
    },
    {
      "lineNumber": 117022,
      "originalJapaneseLine": "「それは……」",
      "translatedEnglishLine": "\"That is...\""
    },
    {
      "lineNumber": 117023,
      "originalJapaneseLine": "「そぉーーっだ、お前のお望みの、",
      "translatedEnglishLine": "\"That's right—it’s what you desire,"
    },
    {
      "lineNumber": 117024,
      "originalJapaneseLine": "　レキシントン様の魔血魂どぅわー」",
      "translatedEnglishLine": "Lord Lexington’s Magic Blood Spirit, bwaaah!\""
    },
    {
      "lineNumber": 117025,
      "originalJapaneseLine": "「おい、今なら許してやる。",
      "translatedEnglishLine": "\"Hey, I’ll forgive you if you do it now."
    },
    {
      "lineNumber": 117026,
      "originalJapaneseLine": "　今すぐシィルを返せ」",
      "translatedEnglishLine": "Give Sil back immediately.\""
    },
    {
      "lineNumber": 117027,
      "originalJapaneseLine": "「返さないなら……」",
      "translatedEnglishLine": "\"If you don’t return her...\""
    },
    {
      "lineNumber": 117028,
      "originalJapaneseLine": "ランスは部屋に備え付けのトイレを開けた。",
      "translatedEnglishLine": "Rance opened the built-in toilet in the room."
    },
    {
      "lineNumber": 117029,
      "originalJapaneseLine": "「お前の大事な大事なレキシントンは",
      "translatedEnglishLine": "\"Your precious, precious Lexington"
    },
    {
      "lineNumber": 117030,
      "originalJapaneseLine": "　哀れ下水道でうんこまみれだー！」",
      "translatedEnglishLine": "is pitifully covered in poop down in the sewer!\""
    }
  ]
}

